import React from "react";
import { Link } from "react-router-dom";

function resultsSeach({children}) {
  return (
    <div className="text-center">
      <img alt={children} className="img-fluid" src={children} style={{ margin: "0 auto" }} />
      <h3>title: {children}</h3>
      <h4>Auther(s): {children}</h4>
      <p>description: {children}</p>
      {/* <Link to={children}>{children}</Link> */}
    </div>
  );
}

export default resultsSeach;
